import "./Page3pop.css";
import React from "react";
import HexagonGrid from "./HexagonGrid";

function PopUp() {
  return (
    <div>
      <div>
        <HexagonGrid width={800} height={600} size={50} />
      </div>
    </div>
  );
}
export default PopUp;
